						beginAtZero: true,
					},
				},
			],
		},
	};

	return (
		<div style={{ margin: "100px" }}>
			<div className={classes.Chart}>
				<Bar data={data} options={options} />
			</div>
		</div>
	);
};

export default Analysis;
